function [A, b]=SMSS_state_space(r_e,m_e,a_s)
%% Single Magnet Single Superconductor Hand Derived Linearization
% assume superconductor is at origin (0,0,0)
% inputs: 
% r_e - equilibrium position of magnet 
% m_e - equilibrium orientation of magnet
% a_s - direction normal to superconductor surface
% d_r - translational displacement of magnet position from equilibrium
% d_m - angular displacement of magnet orientation from equilibrium
%% set up geometry of system
mu_0=4*pi*10^-7;    % permeability of free space
mu=norm(m_e);          % magnetic field strength of .75 in D N42 spherical NdFeB magnet
% a_s=[0 0 1]';       % superconductor normal
% r_e=[0 0 0.01]';    % position of magnet, separation distance of 1 cm above superconductor
r_fe=(eye(3)-2*(a_s*a_s'))*r_e;  % position of frozen image
r_me=r_fe;          % position of mobile image
% m_e=mu*[0 0 1]';    % orientation of magnet, pointing upward
m_fe=m_e;           % orientation of frozen image
m_me=(eye(3)-2*(a_s*a_s'))*m_e;  % orientation of mobile image
rho_fe=r_e-r_fe;    % equilibrium distance from frozen image to magnet
rho_me=r_e-r_me;    % equilibrium distance from mobile image to magnet
M=27.2e-3*eye(3);   % mass of spherical magnet
I=2/5*M*(0.75*2.54/100)^2;  % inertia of spherical magnet
%% define linearization terms
%define cross terms for simpler syntax later on
rho_fex=crs(rho_fe);
rho_mex=crs(rho_me);
m_ex=crs(m_e);
m_fex=crs(m_fe);
m_mex=crs(m_me);

% superconductor normal
a_sx=a_s(1); a_sy=a_s(2); a_sz=a_s(3);
% equilibrium position
rho_fe_x=rho_fe(1); rho_fe_y=rho_fe(2); rho_fe_z=rho_fe(3);
rho_me_x=rho_me(1); rho_me_y=rho_me(2); rho_me_z=rho_me(3);
% equilibrium magnet orientation
m_x=m_e(1); m_y=m_e(2); m_z=m_e(3);
% equilibrium image orientation
m_fx=m_fe(1); m_fy=m_fe(2); m_fz=m_fe(3);
m_mx=m_me(1); m_my=m_me(2); m_mz=m_me(3);

%% Force and Torque at linearization point
F_fe=3*mu_0/(4*pi*norm(rho_fe)^5)*(...
    rho_fe*dot(m_e,m_fe)+...
    m_e*dot(rho_fe,m_fe)+...
    m_fe*dot(rho_fe,m_e)+...
    -5/norm(rho_fe)^2*rho_fe*dot(rho_fe,m_e)*dot(rho_fe,m_fe));
F_me=3*mu_0/(4*pi*norm(rho_me)^5)*(...
    rho_me*dot(m_e,m_me)+...
    m_e*dot(rho_me,m_me)+...
    m_me*dot(rho_me,m_e)+...
    -5/norm(rho_me)^2*rho_me*dot(rho_me,m_e)*dot(rho_me,m_me));
F_e=F_fe+F_me;

tau_fe=mu_0/(4*pi*norm(rho_fe)^5)*(...
    3*dot(m_e,rho_fe)*cross(m_fe,rho_fe) +...
    norm(rho_fe)^2*cross(m_e,m_fe));
    
tau_me=mu_0/(4*pi*norm(rho_me)^5)*(...
    3*dot(m_e,rho_me)*cross(m_me,rho_me) + ...
    norm(rho_me)^2*cross(m_e,m_me));

tau_e=tau_fe+tau_me;
%% Entire Jacobian for Force and Torque from dr and dm
dFtau_drm=[                                                                                                                                                                                           (3*mu_0*((2*a_sx*a_sy*(m_my*m_x*rho_me_y^2 - 4*m_my*m_x*rho_me_x^2 - 5*m_mx*m_x*rho_me_z^2 - 5*m_mx*m_x*rho_me_y^2 + m_my*m_x*rho_me_z^2 + 6*m_mx*m_y*rho_me_x^2 + m_mx*m_y*rho_me_y^2 - 5*m_my*m_y*rho_me_x^2 + m_mx*m_y*rho_me_z^2 - 5*m_my*m_y*rho_me_z^2 - 5*m_mz*m_z*rho_me_x^2 - 5*m_mz*m_z*rho_me_y^2 + 5*m_my*m_x*rho_me_x*rho_me_y + 5*m_mz*m_x*rho_me_x*rho_me_z + 5*m_mx*m_y*rho_me_x*rho_me_y + 5*m_mz*m_y*rho_me_x*rho_me_z + 5*m_mz*m_y*rho_me_y*rho_me_z + 5*m_mx*m_z*rho_me_x*rho_me_z - 5*m_my*m_z*rho_me_x*rho_me_z + 5*m_my*m_z*rho_me_y*rho_me_z))/(rho_me_x^2 + rho_me_y^2 + rho_me_z^2) - (2*a_sx^2*(2*m_mx*m_x*rho_me_x^2 + 7*m_mx*m_x*rho_me_y^2 + 7*m_mx*m_x*rho_me_z^2 + 9*m_my*m_y*rho_me_x^2 + 4*m_my*m_y*rho_me_y^2 + 9*m_my*m_y*rho_me_z^2 + 9*m_mz*m_z*rho_me_x^2 + 9*m_mz*m_z*rho_me_y^2 + 4*m_mz*m_z*rho_me_z^2 - 10*m_my*m_x*rho_me_x*rho_me_y - 10*m_mz*m_x*rho_me_x*rho_me_z - 5*m_mz*m_y*rho_me_y*rho_me_z - 5*m_my*m_z*rho_me_y*rho_me_z))/(rho_me_x^2 + rho_me_y^2 + rho_me_z^2) + (2*a_sx*a_sz*(m_mz*m_x*rho_me_y^2 - 5*m_mx*m_x*rho_me_z^2 - 4*m_mz*m_x*rho_me_x^2 - 5*m_mx*m_x*rho_me_y^2 + m_mz*m_x*rho_me_z^2 - 5*m_my*m_y*rho_me_x^2 - 5*m_my*m_y*rho_me_z^2 + 6*m_mx*m_z*rho_me_x^2 + m_mx*m_z*rho_me_y^2 + m_mx*m_z*rho_me_z^2 - 5*m_mz*m_z*rho_me_x^2 - 5*m_mz*m_z*rho_me_y^2 + 5*m_my*m_x*rho_me_x*rho_me_y + 5*m_mz*m_x*rho_me_x*rho_me_z + 5*m_mx*m_y*rho_me_x*rho_me_y - 5*m_mz*m_y*rho_me_x*rho_me_y + 5*m_mz*m_y*rho_me_y*rho_me_z + 5*m_mx*m_z*rho_me_x*rho_me_z + 5*m_my*m_z*rho_me_x*rho_me_y + 5*m_my*m_z*rho_me_y*rho_me_z))/(rho_me_x^2 + rho_me_y^2 + rho_me_z^2)))/(4*pi*(rho_me_x^2 + rho_me_y^2 + rho_me_z^2)^(5/2)) - (3*mu_0*(2*m_fx*m_x*rho_fe_x^2 + 7*m_fx*m_x*rho_fe_y^2 + 7*m_fx*m_x*rho_fe_z^2 + 9*m_fy*m_y*rho_fe_x^2 + 4*m_fy*m_y*rho_fe_y^2 + 9*m_fy*m_y*rho_fe_z^2 + 9*m_fz*m_z*rho_fe_x^2 + 9*m_fz*m_z*rho_fe_y^2 + 4*m_fz*m_z*rho_fe_z^2 - 10*m_fy*m_x*rho_fe_x*rho_fe_y - 10*m_fz*m_x*rho_fe_x*rho_fe_z - 5*m_fz*m_y*rho_fe_y*rho_fe_z - 5*m_fy*m_z*rho_fe_y*rho_fe_z))/(4*pi*(rho_fe_x^2 + rho_fe_y^2 + rho_fe_z^2)^(7/2)) - (15*mu_0*rho_fe_x*(m_fy*m_x*rho_fe_y^3 - 2*m_fx*m_x*rho_fe_x^3 + m_fz*m_x*rho_fe_z^3 + m_fx*m_y*rho_fe_y^3 + m_fy*m_y*rho_fe_x^3 + m_fx*m_z*rho_fe_z^3 + m_fz*m_z*rho_fe_x^3 + 3*m_fx*m_x*rho_fe_x*rho_fe_y^2 + 3*m_fx*m_x*rho_fe_x*rho_fe_z^2 - 4*m_fy*m_x*rho_fe_x^2*rho_fe_y + m_fy*m_x*rho_fe_y*rho_fe_z^2 - 4*m_fz*m_x*rho_fe_x^2*rho_fe_z + m_fz*m_x*rho_fe_y^2*rho_fe_z - 4*m_fx*m_y*rho_fe_x^2*rho_fe_y - 4*m_fy*m_y*rho_fe_x*rho_fe_y^2 + m_fx*m_y*rho_fe_y*rho_fe_z^2 + m_fy*m_y*rho_fe_x*rho_fe_z^2 - 4*m_fx*m_z*rho_fe_x^2*rho_fe_z + m_fx*m_z*rho_fe_y^2*rho_fe_z + m_fz*m_z*rho_fe_x*rho_fe_y^2 - 4*m_fz*m_z*rho_fe_x*rho_fe_z^2 - 5*m_fz*m_y*rho_fe_x*rho_fe_y*rho_fe_z - 5*m_fy*m_z*rho_fe_x*rho_fe_y*rho_fe_z))/(4*pi*(rho_fe_x^2 + rho_fe_y^2 + rho_fe_z^2)^(9/2)) - (15*a_sx^2*mu_0*rho_me_x*(m_my*m_x*rho_me_y^3 - 2*m_mx*m_x*rho_me_x^3 + m_mz*m_x*rho_me_z^3 + m_mx*m_y*rho_me_y^3 + m_my*m_y*rho_me_x^3 + m_mx*m_z*rho_me_z^3 + m_mz*m_z*rho_me_x^3 + 3*m_mx*m_x*rho_me_x*rho_me_y^2 + 3*m_mx*m_x*rho_me_x*rho_me_z^2 - 4*m_my*m_x*rho_me_x^2*rho_me_y + m_my*m_x*rho_me_y*rho_me_z^2 - 4*m_mz*m_x*rho_me_x^2*rho_me_z + m_mz*m_x*rho_me_y^2*rho_me_z - 4*m_mx*m_y*rho_me_x^2*rho_me_y - 4*m_my*m_y*rho_me_x*rho_me_y^2 + m_mx*m_y*rho_me_y*rho_me_z^2 + m_my*m_y*rho_me_x*rho_me_z^2 - 4*m_mx*m_z*rho_me_x^2*rho_me_z + m_mx*m_z*rho_me_y^2*rho_me_z + m_mz*m_z*rho_me_x*rho_me_y^2 - 4*m_mz*m_z*rho_me_x*rho_me_z^2 - 5*m_mz*m_y*rho_me_x*rho_me_y*rho_me_z - 5*m_my*m_z*rho_me_x*rho_me_y*rho_me_z))/(2*pi*(rho_me_x^2 + rho_me_y^2 + rho_me_z^2)^(9/2)) - (15*a_sx*a_sy*mu_0*rho_me_y*(m_my*m_x*rho_me_y^3 - 2*m_mx*m_x*rho_me_x^3 + m_mz*m_x*rho_me_z^3 + m_mx*m_y*rho_me_y^3 + m_my*m_y*rho_me_x^3 + m_mx*m_z*rho_me_z^3 + m_mz*m_z*rho_me_x^3 + 3*m_mx*m_x*rho_me_x*rho_me_y^2 + 3*m_mx*m_x*rho_me_x*rho_me_z^2 